literals:
mutation($email: String!, $password: String!) {
    logIn(email: $email, password: $password) {
      id
      token
    }
}

mutation SIGNUP_MUTATION(
    $name: String!
    $email: String!
    $password: String!
  ) {
    signUp(name: $name, email: $email, password: $password) {
      id
      token
    }
  }
